import ExpenseItem from "./ExpenseItem"

const ExpenseList = (props) => {
    let expenseContent = <p>NO DATA FOUND</p>

    if (props.expenses.length >0){
        expenseContent = props.expenses.map((temp) => 
            <ExpenseItem
            key = {temp.id}
            title = {temp.title}
            amount = {temp.amount}
            date = {temp.date}
            />
        )
    }

}

export default ExpenseList
